INSERT INTO `qstn_suggestion` VALUES ('147', 'ผู้รับบริการ อายุ มากกว่า 60 ปีขึ้นไป มีจำนวนมากขึ้นต้องการมารับบริการมากขึ้นแต่นโยบายการรับผู้ป่วยยังไม่ปรับเปลี่ยน ยัง รับอายุ 15 ปีขึ้นไป ทำให้ผู้รับบริการที่เป็นผู้สูงอายุไม่ได้รับความสะดวกทั้งเรื่องคิวตรวจ สถานที่ รอนาน การบริการไม่เฉพาะทาง โอกาสในการรับข้อมูลลดลง ไม่สามารถอำนวยความสะดวกได้อย่างเหมาะสม ควรมีนโยบาย รับเฉพาะผู้รับบริการที่มีอายุ 60 ปี ขึ้นไปเพื่อให้เป็นศูนย์ผู้สูงอายุเฉพาะทางตามวัตถุประสงค์ ', '1', '6', '62032');
