INSERT INTO `qstn_suggestion` VALUES ('154', 'ต้องการให้เเต่ละเเผนกมีหัวหน้าที่จะสามารถรับนโยบายจากผู้บริหารเเละสื่อสารให้ทีมรับทราบพร้อมทั้งรายงานปัญหาต่างๆเพื่อทำเเนวทางเเก้ไขไปพร้อมกัน \r\n ต้องการให้ผู้บริหารพบ พนง. ทุกไตรมาสเพื่อพบปะพูดคุย รับฟังปัญหา สร้างขวัญเเละกำลังใจในการทำงาน\r\n  ต้องการเสนอให้สวัสดิการพนง. เทียบเท่าพนง. อื่นของมหาวิทยาลัย\r\n  เสนอให้มีการจัดรูปเเบบบริการที่เอื้ออำนวยความสะดวก รวดเร็วเข้าถึงกับผู้สูงอายุสำหรับ.GMC ไม่รับคนไข้กลุ่มอื่น\r\n', '1', '6', '59009');
