INSERT INTO `qstn_suggestion` VALUES ('325', '1. การประเมินพนักงาน ควรมีการชี้แจงตั้งแต่เริ่มต้นว่า การจะได้เกณฑ์คะแนนใดๆ จะต้องทำอะไรผลลัพธ์อย่างไรบ้าง และหลังการประเมินมีการชี้แจงว่าได้รับผลการประเมินอะไรเพราะอะไร ควรปรับปรุงตัวตรงไหน หรือมีอะไรดีที่ควรทำต่อไป\r\n2. ควรมีการชี้แจง carrier path ที่ชัดเจน ในทุกสายงาน เนื่องจากพนักงานไม่เห็นภาพว่าในอีกกี่ปีต่อไปข้างหน้า จะเป็นยังไง สามารถพัฒนาไปสู่จุดไหน และพนักงานจะต้องพัฒนาตัวเองในด้านใดบ้าง\r\n3. ควรมีการประชุมเกี่ยวกับงานทีทำเป็รายคาบ (รายเดือน หรือ รายไตรมาส หรือ รายครึ่งปี) ว่ามีการทำงานอะไรไป มีปัญหาอะไรบ้าง และควรทำอะไรต่อไป เพื่อเป็นแผนในการพัฒนาองค์กรได้อย่างมีประสิทธิภาพ\r\n4. กิจกรรมส่งเสริมความสัมพันธ์ในองค์กรมีน้อยเกินไป\r\n5. ควรมีการวางแผนความก้าวหน้าของพนักงานในทุกตำแหน่ง ทุกระดับ และมีการชีแจง แจ้งให้ทราบอย่างชัดเจน ถ้าพนักงานรู้สึกอยู่ต่อไปก็เหมือนเดิม พนักงานก็อยากลาออกไปโตที่อื่น\r\n6.  ไม่มีการวางแผนภาระงาน และช่วยในการสกรีนงาน ทำให้มีภาระงานมากเกินไป ยกตัวอย่างเช่น จำนวนงานที่ต้องทำในแต่ละปีอาจใกล้เคียงกัน แต่คนนึงมีงานเดิมที่ต้องดูแลมากกว่า ภาระงานก็มากกว่า\r\n7. ขอบคุณผู้บริหารทุกท่านที่ดูแลเป็นอย่างดีครับ', '1', '6', '61018');
